CumFiesta - Shazia - Something special

Tue October 26, 2010
Shazia came over all the way from Chicago after one of her friends let her know the lowdown about our little 

exclusive parties using one of those social networking sites. She whipped out her nice perky tits and proved she 

knew the password. We let her in, she relaxed, teased us with that gorgeous ass of hers and started playing with 

herself. As soon as I thought she was primed and ready I called Voodoo to take care of her. These two were all over 

each other. Voodoo freaked out a little because she mentioned how she wants to move away from Chicago now and move 

closer so she can visit all the time. He let her down gently but made sure she understood we like the new meat. Not 

many repeat, but she might be hot enough to give her another whirl as long as one of her friends join in as well.
